import React from "react";
import wire3 from "../assets/images/section5wire.svg";
import round from "../assets/images/round.svg";



const Banner = () => {
  return (


      <section className="">

      <div className="flex flex-wrap justify-center mt-5 pt-5 mb-10 pb-10  xl:gap-x-4 gap-y-8 xl:mx-2 h-30">
          <div className="max-w-sm md:w-2/3 lg:max-w-full lg:flex gap-y-8 xl:mx-2">
          <div className="bg-transparent rounded-b lg:rounded-b-none lg:rounded-r p-4 sm:p-1 flex flex-col justify-between leading-normal">
          <div className="mb-8">


          <div className="lg:mt-20 flex -mt-px relative justify-center font-semibold px-10 text-2xl xl:mt-20 sm:text-4xl leading-[2.2rem] md:text-7xl lg:text-7xl xl:text-7xl 2xl:text-7xl text-purple">
                                    TECHNOLOGY
                        </div>

                                <div className="text-5xl sm:text-4xl md:text-7xl px-10 xl:text-7xl lg:text-7xl 2xl:text-8xl mt-2 font-semibold flex text-purple justify-center">
                                  CONSULTING
                                    <br />

                                  PRODUCTS
                                </div>
              <div className="text-purple text-lg flex justify-center">
                <p className="text-lg p-8 md:text-2xl sm:text-xl text-center leading-[2.2rem] sm:w-3/3 md:w-3/3 lg:w-3/3">
                We are part of the solution in building a <span className="text-3xl bold font-semibold text-yellow">SKILLED</span> continent. 
                </p>
              </div>
              </div>



          </div>


          </div>
          <div className="h-60 lg:h-auto lg:w-80 flex-none bg-cover rounded-t m-2 lg:rounded-t-none lg:rounded-l text-center overflow-hidden bg-hero-2">
              </div>
          </div>




    </section>

    );
  };




export default Banner;
